import csv

def get_column_data(csv_file):
    with open(csv_file, 'r') as file:
        reader = csv.reader(file)
        columns = zip(*reader)
        column_data = list(columns)
        return column_data

def print_column_data(column_data):
    for column in column_data:
        print(column)

# Provide the path to your CSV file
